import styled from "@emotion/styled";

export const MainFont = styled.div`
  font-family: Pretendard;
  font-weight: bold;
  color: white;
  width: 100vw;
  font-size: 8vw;
`;

export const MainContainer = styled.div`
  width: 100%;
  height: 100%;
  padding-top: 10rem;
  text-align: center;
`;

export const MainFontContainer = styled.div`
  width: 100vw;
  padding-bottom: 10rem;
`;
export const Line = styled.div`
  display: flex;
  flex-basis: 100%;
  align-items: center;
  color: black;
  font-size: 1.4rem;
  margin: 0.8rem 0rem;
  ::before {
    content: "";
    flex-grow: 1;
    margin: 0rem 1rem 0rem 0rem;
    background: rgba(102, 102, 102, 0.35);
    height: 0.1rem;
    font-size: 0rem;
    line-height: 0rem;
  }
  ::after {
    content: "";
    flex-grow: 1;
    margin: 0rem 0rem 0rem 1rem;
    background: rgba(102, 102, 102, 0.35);
    height: 0.1rem;
    font-size: 0rem;
    line-height: 0rem;
  }
`;

export const Background = styled.div`
  width: 100%;
  background-color: rgba(98, 129, 224);
`;

export const LineLogo = styled.img`
  width: 100%;
  padding-top: 10rem;
`;

export const description = styled.div`
  font-size: 1.2rem;
  font-weight: 0.5rem;
  color: white;
  padding-top: 1rem;
`;

export const text1 = styled.div`
  margin-top: 1rem;
  margin-bottom: 1rem;
`;
export const leftBoxContainer = styled.div`
  width: 70%;
  padding-bottom: 10rem;
  @media screen and (max-width: 50rem) {
    padding-bottom: 5rem;
  }
`;
export const leftBox = styled.div`
  width: 65%;
  margin-top: 4rem;
  padding-top: 10rem;
  @media screen and (max-width: 100rem) {
    width: 75%;
  }
  @media screen and (max-width: 50rem) {
    padding-top: 5rem;
  }
  border-radius: 0rem 20rem 20rem 0rem;
  background-color: rgba(176, 192, 239);
`;

export const leftBoxTitle = styled.div`
  color: #ffffff;
  font-size: 6vw;
  font-weight: 500;
  text-align: left;
  margin-left: 4rem;
`;

export const leftBoxText = styled.div`
  text-align: left;
  margin-top: 1rem;
  margin-left: 4rem;
  font-size: 2vw;
`;
